DELIMITER $$

--
-- Описание для триггера attemptsAdded
--
DROP TRIGGER IF EXISTS attemptsAdded$$
CREATE
  DEFINER = 'mysqlroot'@'%'
TRIGGER attemptsAdded
AFTER UPDATE
ON tcardusers
FOR EACH ROW
  BEGIN
    IF (NEW.dayAttemptsUsed = 0 AND OLD.dayAttemptsUsed >= 100)
    THEN
      IF NOT EXISTS(SELECT
                      *
                    FROM tcardnotifications
                    WHERE tcardnotifications.userId = NEW.userId)
      THEN
      END IF;
    END IF;
  END
$$

